import React from 'react';
import logo from './logo.png';
import './App.css';
// import { Layout} from 'antd';

// const { Header, Content, Footer } = Layout;
import Signup from './components/signup';
import Login from './components/login';
import Home from './components/home';
import ConfirmPay from './components/confirm-pay';

const Layout = () => <div></div>
const Header = () => <head></head>
const Content = ()  => <body></body>
const Footer = () => <footer></footer>

const Wrapper = (props) => (
  <div class="App">
    <head className="App-header">{props.header}</head>
    <body className="App-body">{props.body}</body>
    <footer className="App-footer">{props.footer}</footer>
  </div>

);

const header = <img src={logo} alt="" className="App-logo"></img>  
const body =  <div> <Home/> <ConfirmPay/> <Login/> </div>
const footer = <h3 color="white">something here about signing up</h3>

const App = () => <Wrapper
  header = {header}
  body = {body}
  footer = {footer}
  theme = "light"
  />

export default App;
